5000kモデル JKラングラー専用キャンセラー内蔵LED交換バルブ 純正比2倍(純正測定値：81ｈｃｄから　交換後測定値：168ｈｃｄ)の明るさで安全な夜間走行をお約束！長時間使用でも冷却ファン、銅基盤により性能を維持します。省エネルギーによる「エコ」消費電力は20W、「配光性」も拘りました。<br><br>●lm数1900ｌｍ（片側） 左右合計3800lm（左右合計値）<br><br>※適合の詳細につきましてはメーカーホームページもご確認ください。保証期間は１年です。　安心してお使いいただけます。<br><br>対応車種：クライスラーJKラングラー<br><br><br><br><tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


